import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import axios from 'axios';

const defaultTheme = createTheme();
const baseAddress = "http://localhost:3000";

export default function Mypage() {
  const [subtitles, setSubtitles] = useState([]);
  const [userData, setUserData] = useState({ user_id: '', user_email: '' });
  const navigate = useNavigate();

  useEffect(() => {
    // localStorage에서 user_id와 user_email을 가져옴
    const userId = localStorage.getItem('user_id');
    const userEmail = localStorage.getItem('user_email');

    // 사용자 정보를 상태로 저장
    setUserData({
      user_id: userId,
      user_email: userEmail,
    });

    // 서버에서 자막 데이터를 가져올 수 있는 로직 추가 (예시)
    const fetchSubtitles = async () => {
      const token = localStorage.getItem('token'); // 토큰 가져오기
      try {
        const response = await axios.get(`${baseAddress}/user/subtitles`, {
          headers: {
            'Authorization': `Bearer ${token}`, // Authorization 헤더에 토큰 포함
          },
        });
        setSubtitles(response.data.subtitles); // 서버에서 받은 자막 데이터를 상태로 저장
      } catch (error) {
        console.error('자막 데이터를 가져오는 중 에러 발생:', error);
      }
    };

    fetchSubtitles();
  }, []);

  const handleDeleteSubtitle = (index) => {
    const updatedSubtitles = subtitles.filter((_, i) => i !== index);
    setSubtitles(updatedSubtitles);
  };

  const handleEditClick = () => {
    navigate('/edit');
  };

  return (
    <ThemeProvider theme={defaultTheme}>
      <Container component="main" maxWidth={false} sx={{ height: '100vh' }}>
        <CssBaseline />
        <Box
          sx={{
            marginTop: 'auto',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'center',
            height: '100%',
          }}
        >
          <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>
            {/* 아이콘을 원하시면 추가 */}
          </Avatar>
          <Typography component="h1" variant="h5">
            마이페이지
          </Typography>
          <Box component="div" noValidate sx={{ mt: 3, width: '100%' }}>
            <Grid container spacing={2}>
              <Grid item xs={12}>
                <Box className="bg-white rounded-lg p-4 border border-gray-300">
                  <Typography component="h2" variant="h6">
                    내 정보
                  </Typography>
                  <Typography component="p">
                    <strong>이름: </strong>{userData.user_id}
                  </Typography>
                  <Typography component="p">
                    <strong>이메일: </strong>{userData.user_email}
                  </Typography>
                </Box>
              </Grid>
            </Grid>

            <Box sx={{ mt: 3 }}>
              <Typography component="h2" variant="h6">
                내 자막 리스트
              </Typography>
              <Grid container spacing={2}>
                {subtitles.map((subtitle, index) => (
                  <Grid item xs={12} key={index}>
                    <Box className="bg-white rounded-lg shadow-md p-4 border border-gray-300">
                      <Typography component="h2" variant="h6" gutterBottom>
                        {subtitle.title}
                      </Typography>
                      <Typography>{subtitle.summary}</Typography>
                      <Typography>{subtitle.date}</Typography>
                      <Box sx={{ mt: 2 }}>
                        <Button variant="outlined" onClick={handleEditClick}>
                          자막 편집
                        </Button>
                        <Button
                          variant="contained"
                          color="error"
                          onClick={() => handleDeleteSubtitle(index)}
                          sx={{ ml: 2 }}
                        >
                          삭제
                        </Button>
                      </Box>
                    </Box>
                  </Grid>
                ))}
              </Grid>
            </Box>
          </Box>
        </Box>
      </Container>
    </ThemeProvider>
  );
}
